    <style scope="iron-dropdown">
        iron-dropdown {
            position: fixed;
        }

        #contentWrapper.iron-dropdown > * {
            overflow: auto;
        }

        #contentWrapper.animating.iron-dropdown > * {
            overflow: hidden;
        }
    </style><!-- Shady DOM styles for iron-pages -->
    <style scope="iron-pages">
        iron-pages {
            display: block;
        }

            iron-pages > :not(slot):not(.iron-selected) {
                display: none !important;
            }
    </style><!-- Shady DOM styles for iron-selector --><!-- Shady DOM styles for scale-up-animation --><!-- Shady DOM styles for scale-down-animation --><!-- Shady DOM styles for paper-ripple -->
    <style scope="paper-ripple">
        paper-ripple {
            display: block;
            position: absolute;
            border-radius: inherit;
            overflow: hidden;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            pointer-events: none;
        }

            paper-ripple[animating] {
                -webkit-transform: translate(0, 0);
                transform: translate3d(0, 0, 0);
            }

        #background.paper-ripple, #waves.paper-ripple, .wave-container.paper-ripple, .wave.paper-ripple {
            pointer-events: none;
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
        }

        #background.paper-ripple, .wave.paper-ripple {
            opacity: 0;
        }

        #waves.paper-ripple, .wave.paper-ripple {
            overflow: hidden;
        }

        .wave-container.paper-ripple, .wave.paper-ripple {
            border-radius: 50%;
        }

        paper-ripple.circle #background.paper-ripple, paper-ripple.circle #waves.paper-ripple {
            border-radius: 50%;
        }

        paper-ripple.circle .wave-container.paper-ripple {
            overflow: hidden;
        }
